/**
 * client/src/components/Navbar.js
 * AI-generated navbar. Human-read notes: make links conditional based on auth state and improve mobile layout.
 */
import React from 'react';
import { Link } from 'react-router-dom';

const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '12px 20px',
    backgroundColor: '#939699ff',
    color: 'white'
  },
  brand: {
    fontWeight: 'bold',
    fontSize: '18px'
  },
  navLinks: {
    display: 'flex',
    gap: '12px'
  },
  link: {
    color: 'white',
    textDecoration: 'none'
  }
};

export default function Navbar() {
  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location = '/';
  };

  return (
    <header style={styles.navbar}>
      <div style={styles.brand}>Job Portal</div>
      <nav style={styles.navLinks}>
        <Link style={styles.link} to="/dashboard">Dashboard</Link>
        <Link style={styles.link} to="/analysis">Analysis</Link>
        <Link style={styles.link} to="/profile">Profile</Link>
                    <button onClick={handleLogout} className="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded-md text-sm font-medium">
              Logout
            </button>
      </nav>
    </header>
  );
}
